import type { AppProps } from "next/app";
import Home from ".";
import "../styles/globals.css";

export default function App({ Component, pageProps }: AppProps) {
  return (
    <div>
      <nav className="mb-10">
        <div className="flex justify-center">
          <h1 className="text-3xl">Burger</h1>
        </div>
        <ul className="flex justify-center">
          <li className="pr-6">
            <a>Hjem</a>
          </li>
          <li className="pr-6">Om oss</li>
          <li className="pr-6">Tilbud</li>
          <li className="pr-6">Meny</li>
          <li>Kontakt oss</li>
        </ul>
      </nav>

      <div>
        <Home />
      </div>
    </div>
  );
}
